import React from 'react';

const Form = ({submitFn}) => (
<form className="form__form" onSubmit={submitFn}>
    <input placeholder="name" name="name" />
    <input placeholder="link" name="link" />
    <input placeholder="image" name="image" />
    <textarea placeholder="description" name="description" />
    <button className="form__button" type="submit">add new item</button>
</form>
);
// funkcja submitFM w parametrze Form i w wywołaniu onsubmit
export default Form;
